팔이 소녀의 재림','드라마','셀러브리티','배우, 영화, 드라마',0,'제로원인터렉티브','대한민국',1,'WOMAN','ACTIVE',0,'','https://www.instagram.com/leechungah','',0,'이청아(1984년 10월 29일 출생)는 대한민국 배우로, 2002년 영화 [translate:성냥팔이 소녀의 재림]으로 데뷔했다. 주요 작품으로는 [translate:늑대의 유혹], [translate:꽃미남 라면가게], [translate:셀러브리티], [translate:연인] 등이 있으며, 로맨틱 코미디와 드라마 분야에서 활약했다. 최근 넷플릭스 및 MBC 등 다양한 채널의 드라마에 주연 및 조연으로 활발히 활동 중이다.'),(86,'박지성','Park Ji-sung','1981-03-30',175,'2000-05-07','교토 퍼플상가 프로 데뷔','스포츠','전북 현대 모터스 테크니컬 디렉터','Football, Sports',0,'전북 현대 모터스','대한민국',1,'MEN','INACTIVE',0,'','','',0,'박지성(朴智星, 1981년 3월 30일 출생)은 대한민국의 전직 축구 선수이자 현 전북 현대 모터스 테크니컬 디렉터이다. 2000년 일본 교토 퍼플상가에서 프로 데뷔 후, PSV 에인트호번, 맨체스터 유나이티드, QPR 등에서 활약하며 프리미어리그 4회 우승, UEFA 챔피언스리그 및 FIFA 클럽 월드컵 등 국제 무대에서도 두각을 나타냈다. 대한민국 최초의 EPL 주장이자 월드컵 3연속 득점자 등 한국 축구사에 큰 족적을 남겼다.'),(87,'김연아','Yuna Kim','1990-09-05',162,'2003-01-01','대한민국 피겨 국가대표 선발','스포츠','평창 동계올림픽 홍보대사','Figure Skating, Sports',0,'','대한민국',1,'WOMAN','INACTIVE',0,'','','',0,'김연아(1990년 9월 5일 출생)는 대한민국의 은퇴한 피겨스케이팅 선수로, 2010 밴쿠버 동계올림픽 금메달리스트이자 2014 소치 동계올림픽 은메달리스트, 세계선수권 2회 우승자이다. 2003년 국가대표 선발을 시작으로 2009년 세계선수권 200점 돌파, 2010년 올림픽 세계신기록 및 대한민국 최초 피겨 금메달을 달성하며, 은퇴 후에는 평창 동계올림픽 홍보대사 등 다양한 스포츠 외교 활동을 이어가고 있다.'),(88,'이병헌','Lee Byung-hun','1970-07-12',177,'1991-01-01','KBS 14기 공채 탤런트','영화','승부','배우, 영화, 드라마',0,'BH엔터테인먼트','대한민국',1,'MEN','ACTIVE',0,'','','',0,'이병헌(1970년 7월 12일 출생)은 대한민국 배우로, 1991년 KBS 14기 공채 탤런트로 데뷔했다. 《공동경비구역 JSA》, 《올인》, 《지.아이.조》, 《광해, 왕이 된 남자》, 《아이리스》, 《달콤한 인생》, 《악마를 보았다》, 《미스터 션샤인》, 《오징어 게임》 등 국내외 작품에서 폭넓은 연기 스펙트럼과 흥행력을 입증했다. 2006년 BH엔터테인먼트 설립 후 한류 대표 배우로, 2025년 《승부》, 《어쩔 수가 없다》에 출연하며 활발히 활동 중이다.'),(89,'박보검','Park Bo-gum','1993-06-16',182,'2011-08-11','영화 블라인드','드라마','굿보이','배우, 드라마, 영화',0,'더블유엠컴퍼니','대한민국',1,'MEN','ACTIVE',0,'','','',0,'박보검(1993년 6월 16일 출생)은 대한민국의 배우로, 2011년 영화 [translate:블라인드]로 데뷔했다. 이후 드라마 [translate:응답하라 1988], [translate:구르미 그린 달빛], [translate:남자친구], [translate:청춘기록], 영화 [translate:명량], [translate:차이나타운] 등에 출연하며 톱스타로 자리매김했다. 2025년 드라마 [translate:굿보이] 등에 출연하며 활발히 활동 중이다.'),(